import React from "react";

const Skills = () => {
  return (
    <div className="main">
      <div className="skills">
        <h1 className="skills-logo">Skills</h1>
        <div className="skill-container">
        <p>Can said skills pay the bills</p>
        </div>
      </div>
    </div>
  );
};

export default Skills;
